('ja', '_template', 'atutor_accessibility_text', '<p>ATutor はコンテンツが全てのユーザがアクセスできるように 設計されています。身体的障害でウェブにアクセスする為にサポートソフトウェアを使用している人々や専用ブラウザ等全ての環境で適切にアクセスする事が可能です。これらの特徴は以下で詳細に説明します。使用しているテーマによってATutorは以下の特徴が含まれます。デフォルトテーマには全て含まれます。</p>\r\n<ol> <li><strong>リンクの最適化:</strong> ATutorは一番上の左隅にコンテンツへのアクセスキーを提供しています。Press the Tab key once after a page has finished loading to advance to the first bypass link then press Enter to reposition the content to the top of your screen. The content anchor can also be accessed with an accesskey [Alt-c], so it is possible to jump to the top of the content area no matter where the cursor might be located on the screen.<br /><br /> Other bypass links include: \"jump past table\" so users can skip over various data table to quickly access content that may appear after the table; \"jump past codes\", so users can skip over the emoticon codes near the bottom of message posting form in the Forums.<br /><br /></li> <li><strong>Accesskeys:</strong> Keyboard accessibility has been added to many ATutor features. To activate accesskeys, press Alt plus the assigned number, letter, or character. Accesskeys are assigned dynamically to the tabs in the Main Navigation. The first tab will be assigned [Alt-1], the second tab will be assigned [Alt-2], and so on. Note that not all browsers support accesskeys.<br /><br /> General AccessKeys <ul> <li>[Alt-1 to Alt-0] Main Navigation Tabs</li> <li>[Alt-,] Previous topic (i.e. Left angle bracket <)</li> <li>[Alt-.] Next topic (i.e. Right angle bracket > )</li> <li>[Alt-.] Resume (i.e. Right angle bracket > while outside the course content)</li> <li>[Alt-j] Jump Menu</li> <li>[Alt-s] Submit (active on many form pages)</li> <li>[Alt-c] Jump to content top (top and navigation bypass link)</li> </ul> Content Editor AccessKeys <ul> <li>[Alt-n] Content Tab</li> <li>[Alt-p] Properties Tab</li> <li>[Alt-g] Glossary Tab</li> <li>[Alt-r] Preview Tab</li> <li>[Alt-a] Accessibility Tab</li> <li>[Alt-s] Save</li> </ul> Chat AccessKeys <ul> <li>[Alt-c] Jump to Compose Message field</li> <li>[Alt-r] Refresh Messages</li> <li>[Alt-m] Jump to Message List</li> <li>[Alt-q] Quit Chat</li> </ul> Inbox AccessKeys <ul> <li>[Alt-r] Reply to Messages</li> </ul> <br /> </li> <li><strong>Accessibility Verifier: </strong>While using the ATutor Content Editor, instructors can check the accessibility of their content to be sure it can accessed by all students, including those using assistive technologies, or older technologies. While using the Content Editor, select [Alt-a] to open the accessibility verifier.</li> <li><strong>Alternative Text: </strong>All meaningful images in ATutor include a text alternative that describes the image or its function. Where images are not meaningful the Alt attribute is left empty so assistive technologies will ignore the image.</li> <li><strong>Alternative Navigation: </strong>Global, hierarchical, and sequential navigation tools are available so users can view or structure content in a manner that suits their style of learning. The ATutor SiteMap provides a full list of all content and tools available, so all features in a course can be accessed from a single location.</li> <li><strong>Resume/Continue: </strong>ATutor remembers the last page accessed when users leave the course content, to go to the Forums for instance, so they can quickly find their way back to where they left off. The content location is also remembered between sessions, so when returning to ATutor, users can simply choose the Resume link in the course listing on My Courses, or select the the resume link in the breadcrumbs at the top of the screen once in a course. Using the [Alt-.] accesskey will also return a user to the last content page they were viewing after they have entered into a course.</li> <li><strong>Hide Menus:</strong> For users of older assistive technologies that do not support columnar text laid out in tables, it is possible to hide ATutor\'s content navigation menu so that content will be displayed in a linear presentation. Hiding the content menu also conserves space for users viewing ATutor on smaller screens.</li> <li><strong>Search and Sort:</strong> Most data tables are accompanied by a search tool, or filter, so specific records can be displayed in the table, reducing the amount of data displayed at any given time. Most data tables can also be sorted by selecting the column header label, again allowing users to narrow down the data display.</li> <li><strong>Table Header Associations: </strong>All data tables are marked up with the TH element and the scope attribute to ensure that screen reader users are able to navigate through data displays and understand what each data cell represents.</li> <li><strong>Form Labels: </strong>All form fields throughout ATutor are marked up using the LABEL element to ensure that they are properly described for assistive technology users. Explicit labeling in this manner also makes it possible to click on a form field\'s label to activate the field. This provides a larger target area for those people who have difficulty positioning a mouse pointer on a small form field such as a radio button or a checkbox.</li> <li><strong>Style Sheets: </strong>Wherever possible, the presentation of content in ATutor is controlled by style sheet elements. This allows users to override ATutor\'s default appearance and apply their own preferred presentation styles (i.e. increased font sizes, different font styles, colours, etc.)</li> <li><strong>Form Field Focus: </strong>For pages where the primary content is a form, the cursor will automatically be placed in the first field so that after a form page loads, users can begin typing into the form. Users may choose to disable form focus in their preference settings if it interferes with their use of form screens.</li> <li><strong>Relative Sizing of Images: </strong>With browsers that support resizing of images, ATutor icons can be magnified for users with low vision, making them more easily visible. (e.g. Netscape 7 press Alt +) . Wherever possible relative measures have also been used for other feature within ATutor so when the interface is magnified or reduced, all features resize relative to each other, maintaining the screen\'s symmetry.</li> </ol>', '2006-02-07 01:47:53', ''),
