('ja', '_template', 'atutor_is', '<strong><em>ATutor</em></strong>はオープン・ソースのオンライン<strong>教育コンテンツ管理システム(LCMS)</strong>。ユーザ補助機能・順応性が重視されています。システム管理者は，インストールやアップデートを数分で実行できます。教育者はATutorで短時間で教育コンテンツの作成，まとめ，再配布ができ，オンライン講座の運営ができます。学生は順応性の高い学習環境で学習できます。!', '2005-07-21 01:10:39', ''),
('ja', '_template', 'atutor_links', '<p><a href=\"http://atutor.ca/index.php\">ATutor</a>に関しては以下のリンクから詳しい情報を見る事が出来ます:</p> <ul> <li><a href=\"http://atutor.ca/atutor/docs/index.php\">FAQs</a> - よくある質問と答え</li> <li><a href=\"http://atutor.ca/forums/index.php\">Support Forums</a> - ユーザフォーラムの投稿</li> <li><a href=\"http://atutor.ca/services/index.php\">Support Services</a> - サポートが情報</li> <li><a href=\"http://atutor.ca/atutor/translate/index.php\">Translation</a> - 言語パックのダウンロードと翻訳への参加</li> <li><a href=\"http://atutor.ca/services/licensing.php\">Licensing</a> - ATutorソフトウェアのライセンス情報</li> <li><a href=\"http://atutor.ca/atutor/download.php\">Download ATutor</a> - ATutorの実行に必要なソフトウェアパッケージはここからダウンロードできます。</li> </ul>', '2006-02-05 03:47:48', ''),
