('ja', '_template', 'chat_help_display_blurb', '<p>注意: 設定を<em>ナビゲーション付きN</em>に設定した場合に<em>移動</em> リンクと <em>クリックキー</em>リストが表示されます。</p> <ul> <li>The <em>Jump to Quick Keys</em> link at the top takes you to a list of quick keys for the Chat. </li> <li>The <em>Message Area</em> displays the most recent messages (up to ten). </li> <li>The <em>Jump to Messages</em> links take you to the beginning of the list of messages. (Alt+M) </li> <li>The <em>Refresh Messages</em> link lets you check for new messages (Alt+R). </li> <li>The <em>Compose Message</em> Field and <em>Send Button</em> let you enter and send messages (Alt+C to enter the Compose Field, Enter to send a completed message). </li> </ul>', '2006-02-10 08:05:11', ''),
